eval("module.exports = JSON.parse('{\"en\":{\"main_title\":\"Noto Cathedral\",\"title\":\"Noto Cathedral\",\"years\":\"1740-1776\",\"text1\":\"This small town in the south-east was founded again in the 1700’s. It is the heart and  the starting point  for a visit to the valley of the Sicilian Baroque. Its cathedral, perfectly raised and rebuilt again after 10 years of difficult work, was included in the UNESCO World Heritage Sites.\",\"text2\":\"The limestone limestone façade is an example of late Baroque style, with eclectic elements and a marked neoclassicist aspiration. It stands on the summit of a scenic staircase composed of three ramps dating back to the eighteenth century but renovated at the beginning of the nineteenth century. The typology of the façade is in lateral towers and refers to some French compositions of the eighteenth century, which were inspired by the architects of the time.\",\"text3\":\"On the walls of the side aisles it is possible to admire several artwork, including some that survived the collapse of 1996, such as the painting Adoration of the Pastors, made by Giovanni Bonomo in 1783, the painting depicting the Delivery of the Keys to St. Peter, work of 1827 made by Giuseppe Patania, to which are added splendid works by contemporary art, among which the frescoes depicting the Pentecost, present on the vault of the dome, made by Oleg Supereko in 2011.\"},\"ua\":{\"main_title\":\"Собор Ното\",\"title\":\"Собор Ното\",\"years\":\"1740-1776\",\"text1\":\"Це невелике містечко на південному сході було засновано знову в 1700-х роках. Це серце і  початкова точка для відвідування долини сицилійського бароко. Його собор, ідеально піднятий і відновлений знову через 10 років важкої праці, був включений до Світової спадщини ЮНЕСКО.\",\"text2\":\"Вапняковий вапняковий фасад є прикладом стилю пізнього бароко з елементами еклектики та яскраво вираженим неокласичним прагненням. Він стоїть на вершині мальовничих сходів, що складаються з трьох пандусів, датованих вісімнадцятим століттям, але відреставрованих на початку ХІХ ст. Типологія фасаду в бічних вежах і відноситься до деяких французьких композицій вісімнадцятого століття, які були натхненні архітекторами того часу.\",\"text3\":\"На стінах бічних проходів можна помилуватися кількома творами мистецтва, у тому числі деякими, які пережили крах 1996 року, такими як картина «Поклоніння пасторів», зроблена Джованні Бономо в 1783 році, картина із зображенням «Доставки». «Ключів від Св. Петра», робота 1827 року роботи Джузеппе Патанії, до якої додаються чудові твори сучасного мистецтва, серед яких присутні фрески із зображенням П’ятидесятниці на зводі купола, виконані Олегом Супереко в 2011 році.\"},\"es\":{\"main_title\":\"Catedral de Noto\",\"title\":\"Catedral de Noto\",\"years\":\"1740-1776\",\"text1\":\"Este pequeño pueblo en el sureste fue fundado de nuevo en el 1700. Es el corazón y el punto de partida para una visita al valle del barroco siciliano. Su catedral, perfectamente levantada y reconstruida de nuevo después de 10 años de arduo trabajo, fue incluida en el Patrimonio de la Humanidad de la UNESCO.\",\"text2\":\"La fachada de piedra caliza es un ejemplo de estilo barroco tardío, con elementos eclécticos y una marcada aspiración neoclásica. Se alza en la cima de una escalinata escénica compuesta por tres rampas que data del siglo XVIII pero reformada al principio del siglo XIX.La tipología de la fachada es en torres laterales y remite a unas composiciones francesas del siglo XVIII, que se inspiraron en los arquitectos de la época.\",\"text3\":\"En las paredes de los pasillos laterales es posible admirar varias obras de arte, incluidas algunas que sobrevivieron al colapso de 1996, como la pintura Adoración de los pastores, realizada por Giovanni Bonomo en 1783, la pintura que representa la Entrega de las Llaves de San Pedro, obra de 1827 realizada por Giuseppe Patania, a la que se suman espléndidas obras de arte contemporáneo, entre las que destacan los frescos que representan el Pentecostés, presentes en la bóveda de la cúpula, realizados por Oleg Supereko en 2011.\"}}');\n\n//# sourceURL=webpack:///./content/architecture/exemple/noto-cathedral.json?");

